local cats = {}

DEMO_ROTOPAPER = 1
DEMO_SQUISHER = 2
DEMO_ROTOZOOMER = 3
DEMO_ZOOMER = 4
DEMO_SPINNER = 5
DEMO_HIGHEST = DEMO_SPINNER

local catSz = 64
local catDelay = 1
local nextCat = CurTime() + catDelay
hook.Add("Think", "AddCats", function()
	if CurTime() < nextCat then
		return
	end
	local minW = catSz
	local minH = catSz
	local maxW = ScrW() - catSz
	local maxH = ScrH() - catSz

	cats[#cats + 1] = {
		math.random(minW, maxW),
		math.random(minH, maxH),
		HSVToColor(math.random(0, 360), .5, 1),
		math.random(1, DEMO_HIGHEST)
	}
	nextCat = CurTime() + catDelay
end)



local matTranslates = Matrix()
local vecTranslates = Vector()
local function renderCatDemoEffect(idx, x, y, w, h, k)
	local timeObj = (CurTime()) * 128 + k * 42
	local timeObj2 = (CurTime()) * 4 + k * 32
	local timeObj3 = (CurTime()) * 1 + k * 64

	matTranslates:Identity()
	vecTranslates[1] = x
	vecTranslates[2] = y
	matTranslates:SetTranslation(vecTranslates)

	if idx == DEMO_ROTOPAPER then
		matTranslates:SetAngles(Angle(0, timeObj, 0))

		vecTranslates[1] = math.cos(timeObj2)
		vecTranslates[2] = math.sin(timeObj2)
		matTranslates:SetScale(vecTranslates)
	elseif idx == DEMO_ZOOMER then
		vecTranslates[1] = math.sin(timeObj3) + 1.5
		vecTranslates[2] = math.sin(timeObj3) + 1.5
		matTranslates:SetScale(vecTranslates)
	elseif idx == DEMO_SQUISHER then
		vecTranslates[1] = math.cos(timeObj3) + 1.5
		vecTranslates[2] = math.sin(timeObj3) + 1.5
		matTranslates:SetScale(vecTranslates)
	elseif idx == DEMO_ROTOZOOMER then
		matTranslates:SetAngles(Angle(0, timeObj, 0))
		vecTranslates[1] = (timeObj3 % 2) + 1.5
		vecTranslates[2] = (timeObj3 % 2) + 1.5
		matTranslates:SetScale(vecTranslates)
	elseif idx == DEMO_SPINNER then
		vecTranslates[1] = math.cos(timeObj3)
		vecTranslates[2] = 1
		matTranslates:SetScale(vecTranslates)
	end


	vecTranslates[1] = -w * .5
	vecTranslates[2] = -h * .5
	matTranslates:Translate(vecTranslates)
	cam.PushModelMatrix(matTranslates)
		surface.DrawTexturedRect(0, 0, w, h)
	cam.PopModelMatrix()
end


hook.Add("HUDPaint", "RenderTheCat", function()
	surface.SetMaterial(mat_cat)

	for k, v in ipairs(cats) do
		surface.SetDrawColor(v[3])
		--surface.DrawTexturedRect(v[1], v[2], catSz, catSz)

		renderCatDemoEffect(v[4], v[1], v[2], catSz, catSz, k)
	end
end)


local function makeCatRT(idx)
	local rtOut = GetRenderTarget("CatFunny_" .. idx, 64, 64)

	local ow, oh = ScrW(), ScrH()
	render.SetViewPort(0, 0, 64, 64)
	cam.Start2D()
	render.PushRenderTarget(rtOut)
		local randCol = HSVToColor(math.random(0, 360), .6, 1)
		surface.SetDrawColor(randCol)
		surface.SetMaterial(mat_cat)
		surface.DrawTexturedRect(0, 0, ScrW(), ScrH())
	render.PopRenderTarget()
	cam.End2D()
	render.SetViewPort(0, 0, ow, oh)

	return rtOut
end


local lastIDXRT = 1
-- corrupt the materials with the cat
local function corruptEntMaterials(ent)
	if not IsValid(ent) then
		return
	end

	lastIDXRT = lastIDXRT + 1
	local rtMatTarget = makeCatRT(ent:EntIndex())
	for k, v in ipairs(ent:GetMaterials()) do
		local matPtr = Material(v)
		if not matPtr then
			continue
		end
		matPtr:SetTexture("$basetexture", rtMatTarget)
	end

	local matPtr = Material(ent:GetMaterial())
	if not matPtr then
		return
	end
	matPtr:SetTexture("$basetexture", rtMatTarget)
end

local entStore = {}
local currEnt = 1
local nextCorrupt = CurTime()
local corruptWait = .01
hook.Add("Think", "CorruptEntsSlowly", function()
	if CurTime() < nextCorrupt then
		return
	end
	nextCorrupt = CurTime() + corruptWait

	if currEnt > #entStore then
		entStore = ents.GetAll()
		currEnt = 1
	end


	local currEntObj = entStore[currEnt]
	currEnt = currEnt + 1
	if not IsValid(currEntObj) then
		return
	end

	corruptEntMaterials(currEntObj)
end)



local function corruptWorldTex()
	local world = game.GetWorld()
	for k, v in pairs(world:GetBrushSurfaces()) do
		local brush = v
		if not brush then
			continue
		end
		local mat = brush:GetMaterial()

		local hashMat = util.SHA256(mat:GetName())
		local catRT = makeCatRT(hashMat)
		if not catRT then
			return
		end

		local matPtr = Material(mat:GetName())
		matPtr:SetTexture("$basetexture", catRT)
		mat:SetTexture("$basetexture", catRT)
	end
end

corruptWorldTex()


local function renderUICat(self, w, h)


	surface.SetDrawColor(self._catColour)
	surface.SetMaterial(mat_cat)
	surface.DrawTexturedRect(0, 0, w, h)
end




local bannedPanels = {
	["CGModBase"] = true,
	["CBaseViewport"] = true,
	["CHudViewport"] = true,
}

local function attempCorruptPanel(panel)
	if not IsValid(panel) then
		return
	end

	if panel._hasCat then
		return
	end

	local className = panel:GetClassName()
	if bannedPanels[className] then
		return
	end
	print("CORRUPTING; ", className)

	panel._catColour = HSVToColor(math.random(0, 360), .5, 1)
	panel.Paint = renderUICat
	panel._hasCat = true
end




local MAX_CHAIN_LENGTH = 32

local function recursiveReplaceDown(panel)
	if not IsValid(panel) then
		return
	end

	if not panel._childrenTraversed then
		for k, v in ipairs(panel:GetChildren()) do
			if IsValid(v) then
				recursiveReplaceDown(v)
			end
		end
		panel._childrenTraversed = true
	end

	attempCorruptPanel(panel)
end


local function recursiveReplaceUp(panel)
	if not IsValid(panel) then
		return
	end

	local parent = panel:GetParent()
	if IsValid(parent) then
		recursiveReplaceUp(parent)
	end


	if not panel._childrenTraversed then
		for k, v in ipairs(panel:GetChildren()) do
			if IsValid(v) then
				recursiveReplaceDown(v)
			end
		end
		panel._childrenTraversed = true
	end


	attempCorruptPanel(panel)
end


hook.Add("HUDPaint", "CorruptVGUI", function()
	recursiveReplaceUp(vgui.GetHoveredPanel())

end)


